css:
@-moz-document domain("www.youtube.com") {
body {
    background-color: #222222 !important;
}

#content {
    background-color: #222222 !important;
    color: #FFFFFF !important;
}

#appbar-nav {
    background-color: #222222 !important;
    color: #FFFFFF !important;
}

#yt-masthead-container {
    background-color: #222222 !important;
    border-color:#222222;
    color: #FFFFFF !important;
}

#watch7-sidebar-modules{
    background-color: #222222 !important;
    color: #FFFFFF !important;
}

#yt-masthead {
    background-color: #222222 !important;
    color: #FFFFFF !important;
}

#watch7-sidebar-contents {
    background-color: #222222 !important;
    color: #FFFFFF !important;
}

#watch7-sidebar-contents > watch-sidebar-section {
    background-color: #222222 !important;
    color: #FFFFFF !important;
}

#watch-discussion {
    background-color: #222222 !important;
    color: #FFFFFF !important;
}

#action-panel-details {
    background-color: #222222 !important;
    color: #FFFFFF !important;
}
#watch-header {
    background-color: #222222 !important;
    color: #FFFFFF !important;
}
#watch-description-text {
	color: #FFFFFF !important;
}

#watch-uploader-info {
	color: #FFFFFF !important;
}

#comment-section-renderer {
    background-color: #222222 !important;
    color: #FFFFFF !important;
}
#watch-header .yt-user-info a{
    color:#ffffff;
}
#watch7-sidebar .video-list-item a:visited .title, #watch7-sidebar .video-list-item a:visited .title .yt-deemphasized-text{
    color:#ffffff;
}
#watch7-sidebar .watch-sidebar-section:last-child{
    color:#ffffff;
}
hr, html, i, iframe, img, ins, kbd, label, legend, li, menu, object, ol, p, pre, q, s, samp, small, span, strike, strong, sub{
    color:#ffffff;
}
#upload-btn .yt-uix-button-content{
    color:#222222;
}
#guide-container{
    background-color:#222222;
    color:#ffffff;
    border-color:#222222;
}
#browse-items-primary .item-section>li>.yt-lockup-tile, .branded-page-v2-primary-col .branded-page-box, .section-list li .item-section .branded-page-box{
    color:#ffffff;
    background-color:#222222;
    border-color:#222222;
    border-bottom:#222222;
}
.yt-lockup-title a, .yt-lockup:hover a, .yt-lockup:hover .yt-lockup-meta a, .yt-lockup:hover .yt-lockup-description a{
    color:#ffffff;
    background-color:#222222;
    border-color:#222222;
    border-bottom:#222222;
}
}
